import React, {useState, useEffect} from 'react';
import TweetTextList from '../components/TweetTextList';
//import TweetUserInfoList from '../components/TweetUserInfoList';

const ArticlesListPage = () => {

    const [tweetInfo, setTweetInfo] = useState({text:'', user:[]});

    useEffect(() => {
        const fetchData = async () => {
            const result = await fetch(`http://localhost:8000/articles`);
            const body = await result.json();
            setTweetInfo(body);
        }
        fetchData();
    }, []);

    return (
         <>
         
         <TweetTextList tweets={tweetInfo} />
         </>
       
    );
}
//<TweetUserInfoList tweets={tweetInfo.user} />
export default ArticlesListPage;
